const Create_List = () => {
  const create_board_list = () => {};
  return (
    <>
      <div id="create-list" onClick={create_board_list}>
        + create list
      </div>
      <div id="create-list-overlay">
        <Create_List_Input />
        <Create_List_Button />
      </div>
      <div id="board">
        <div id="board-header-container">
          <List_Board_Name />
          <List_Board_Options />
        </div>
        <Add_Card />
      </div>
    </>
  );
};

export default Create_List;
